package templates

//ObjectIndexTemplate is the template for generating the index.ts for the object layer
var ObjectIndexTemplate = `{{- $descriptors := . -}}
// *********************************
// Code generated by sdkgen
// DO NOT EDIT!.
//
// Objects Index.
// *********************************

{{- range $descriptor := $descriptors }}
export {
	{{- range $message := $descriptor.Messages }}
	{{ $message.Message.Name }},
	{{- end }}
} from './{{ $descriptor.TsFileName }}';
{{ end }}
`
